import { createMuiTheme } from '@material-ui/core/styles';
import postnobillscolombo from '/static/post-no-bills/postnobillscolombo-regular.ttf';

const theme = createMuiTheme({
  typography: {
    body1: {
      fontFamily: "colombo",
      fontWeight: 400,
      fontSize: 16,
      color: "white"
    }
  }
})

export default theme
